function BottomPanel({ currentTrain }) {

  const handleTrainClick = (wagon) =>
  {
    console.log(wagon.model);
  };

  return (
    <>
      
      <h2>Active Trains</h2>
      {currentTrain.wagons.map((wagon, index) =>(
        <button className="btn_wagon" key={index} onClick={() => handleTrainClick(wagon)}>
          {index+1}
        </button>
      ))}

      {/* {currentTrain.seats.map((seat, index) => (
        <SeatElement key={index} Seat={seat}/>
      ))}
      <h1>{currentTrain.name}</h1> */}
    </>
  );
}
  
